// COLORS
$grey-dark: #333333;
$grey-light: #ddd;
$grey: #808080;
$green-dark: #1b2e2f;
$brown: #75614c;
$yellow: #a69356;
$green: #1c4934;
$green-light: #93aa7f;
$green-lightlight: #b4bba1;
$red: #DD6744;
$blue: #06c;

$suki-wrapper-text: 620px;
// GENERAL STYLES
#canvas {
    min-height: inherit;
}

$margin-count: 5;
@for $i from 1 through $margin-count {
    .mt-#{$i} {
        margin-top: #{$i}rem;
    }
    .mr-#{$i} {
        margin-right: #{$i}rem;
    }
    .mb-#{$i} {
        margin-bottom: #{$i}rem;
    }
    .ml-#{$i} {
        margin-left: #{$i}rem;
    }
}
.center {
    text-align: center;
}
p {
    margin-bottom: 0.5rem;
    font-size: 0.9rem;
}
a {
    color: $blue;
}
.small {
    font-size: 0.8em;
}

h1,
h2,
h3,
h4,
h5,
h6 {
    color: #333;
    font-family: "Lato light";
    font-weight: 300;
    letter-spacing: 0.1em;
}
h3 {
    font-size: 22px;
    font-style: normal;
    line-height: 1.5;
    text-transform: uppercase;
    margin: 1em 0 0.6em;
}
h2 {
    text-transform: uppercase;
    margin: 1em 0 0.4em;
}
ul {
    list-style-type: none;
    padding-left: 0;
}
em {
    font-size: 0.6em;
}
a.button,
button.button,
span.button {
    background: none;
    border: 1px solid $grey;
    color: $grey;
    font-size: 0.8rem;
    width: max-content;
    padding: 7px 10px;
    border-radius: 0;
    &:hover {
        text-decoration: none;
    }
    &.big {
        font-size: 1rem;
        padding: 10px 15px;
    }
    &.green {
        background: $green-light;
        border: none;
        color: white;
    }
}

button.lng {
    &.active {
        background: #004c99;
        color: white;
        border-color: #004c99;
    }
}
input {
    display: block;
}

.right {
    margin-right: 0;
    margin-left: auto;
}
input.numberbox {
    border: 1px solid $grey;
    width: 35px;
    line-height: inherit;
    padding: 0;
    border-radius: 0;
    font-weight: bold;
    text-align: center;
    display: inline-block;
}
.price_big {
    font-family: "Lato";
    font-weight: bold;
    font-size: 1.1rem;
    display: block;
}
.image {
    background-repeat: no-repeat;
    height: 420px;
    &-wood {
        background-image: url(https://naturlogi.se/wp-content/uploads/2019/11/wood4-3.jpg);
        height: 420px;
    }
    &-skogsrum {
        height: 450px;
        background-size: cover;
    }
    &-food {
        height: 350px;
        background-size: cover;
    }
}
.warning {
    position: fixed;
    bottom: 0;
    width: 100%;
    background: $yellow;
    border-top: 2px solid $yellow;
    color: white;
    text-align: center;
    transform: height;
    transition: height 3s ease-out;
    height: fit-content;
}

#tocheckout {
    display: block;
}
.react-calendar__tile:disabled {
    color: $grey-light;
    cursor: default;
    background-color: white;
}
.dates time:first-child {
    &:after {
        display: inline;
        text-align: left;
        font-size: 11px;
        margin: 0px;
        content: "â€”";
    }
}
.dateSelect {
    flex: 1;
    label, input {
        display: inline-block;
        margin-bottom: 0;
    }
}
@media only screen and (max-width: 1020px) {
    p.suki-wrapper,
    .suki-wrapper-text {
        padding: 0 10px;
    }
}
